import React, {memo} from 'react';
import styled from 'styled-components';

const FooterContainer = styled.div`
    background-color: #282828;
    padding:71px 0;
    margin:0 auto;
    text-align: center;
`;

const Footer = memo(() => {
  return (
    <FooterContainer>
      <span>CopyRight 2023. Kimhansol all rights reserved.</span>
      <span>kimhs7858@gmail.com</span>
    </FooterContainer>
  );
});

export default Footer;
